import React from 'react';
import PropTypes from 'prop-types';

export const Row = props => (
 <div> { props.data ? JSON.stringify(props.data): '' }</div>
)

Row.defaultProps = {
  name: 'David'
}

Row.propTypes = {
  name: PropTypes.string
}
